import { useState, useEffect } from "react";
import PhoneInput from "react-phone-input-2";
import "react-phone-input-2/lib/style.css";
import axios from "axios";
import { useNavigate } from "react-router-dom";

const LoginPage = () => {
  const [loading, setLoading] = useState(true);
  const [phone, setPhone] = useState("");
  const [password, setPassword] = useState("");
  const [phoneError, setPhoneError] = useState("");
  const [passwordError, setPasswordError] = useState("");
  const [touched, setTouched] = useState({ phone: false, password: false });
  const [errorMessage, setErrorMessage] = useState("");

  const navigate = useNavigate();

  useEffect(() => {
    const timer = setTimeout(() => setLoading(false), 2000);
    return () => clearTimeout(timer);
  }, []);

  // Visme scriptni yuklash
  useEffect(() => {
    const script = document.createElement("script");
    script.src = "https://static-bundles.visme.co/forms/vismeforms-embed.js";
    script.async = true;
    document.body.appendChild(script);

    return () => {
      document.body.removeChild(script);
    };
  }, []);

  const validatePhone = (value) => {
    if (!value || value.length < 12) {
      return "Telefon raqam to‘liq kiritilishi kerak";
    }
    return "";
  };

  const validatePassword = (value) => {
    if (!value || value.length < 4) {
      return "Parol 4 ta belgidan kam bo‘lmasligi kerak";
    }
    return "";
  };

  const handleContinue = async () => {
    try {
      const res = await axios.post(
        `http://167.86.121.42:8080/auth/login?phone=${phone}&password=${password}`
      );

      console.log(res.data);

      if (res.data.success) {
        const role = res.data.message;
        if (role === "ADMIN") navigate("/admin-dashboard");
        else if (role === "TEACHER") navigate("/teacher-dashboard");
        else if (role === "USER") navigate("/user-dashboard");
        else if (role === "PARENTS") navigate("/user-dashboard");
        else setErrorMessage("⚠️ Noma'lum rol qaytdi.");
      } else {
        setErrorMessage("❌ Login ma'lumotlari noto‘g‘ri.");
      }
    } catch (err) {
      console.error(err);
      setErrorMessage("❌ Serverga ulanishda xatolik.");
    }
  };

  if (loading) {
    return (
      <div className="h-screen flex items-center justify-center">
        <div className="animate-spin rounded-full h-16 w-16 border-b-4 border-[#208a00]"></div>
      </div>
    );
  }

  return (
    <div className="bg-[#F3F4F6]">
      <div className="select-none min-h-screen flex flex-col items-center justify-center sm:mx-auto mx-4 py-10 space-y-10">
        {/* LOGIN CARD */}

        {/* VISME FORM */}
        <div className="w-full max-w-2xl bg-white rounded-xl shadow-md p-4">
          <motion.div
            initial={{ opacity: 0, x: 50 }}
            animate={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.8 }}
            className="w-full max-w-2xl bg-white rounded-xl shadow-md p-4"
          >
            <div
              className="visme_d"
              data-title="Webinar Registration Form"
              data-url="g7ddqxx0-untitled-project?fullPage=true"
              data-domain="forms"
              data-full-page="false"
              data-min-height="600px"
              data-form-id="133190"
            >
 <div className="bg-[#fff] w-full max-w-sm p-1 rounded-xl shadow-md">
          <div className="bg-transparent rounded-xl p-6 w-full flex flex-col">
            <h2 className="text-2xl font-semibold text-center mb-4">Login</h2>

            {/* Phone */}
            <PhoneInput
              value={phone}
              onChange={(val) => {
                setPhone(val);
                setPhoneError(validatePhone(val));
                setTouched((prev) => ({ ...prev, phone: true }));
              }}
              onFocus={() => {
                if (!phone) setPhone("+998");
              }}
              placeholder="+998 99-999-99-99"
              inputProps={{
                name: "phone",
                required: true,
                className: `border-[1.8px] border-[#00000049] outline-none px-4 py-3 my-2 rounded-lg w-full ${
                  phoneError && touched.phone
                    ? "border-red-600"
                    : "border-[#D1D5DB] focus:ring-[#208a00]"
                }`,
              }}
            />

            {/* Password */}
            <input
              type="password"
              placeholder="Password"
              value={password}
              onChange={(e) => {
                const val = e.target.value;
                setPassword(val);
                setPasswordError(validatePassword(val));
                setTouched((prev) => ({ ...prev, password: true }));
              }}
              className={`border-[1.8px] border-[#00000049] outline-none px-4 py-3 my-2 rounded-lg ${
                passwordError && touched.password
                  ? "border-red-600"
                  : "border-[#D1D5DB]"
              }`}
            />

            {/* Button */}
            <button
              onClick={handleContinue}
              className="w-full mt-5 btn-gradient text-white py-2 rounded-lg font-semibold transition"
            >
              Continue
            </button>
            {errorMessage && (
              <p className="text-red-600 text-center mt-3">{errorMessage}</p>
            )}
          </div>
        </div>
            </div>
          </motion.div>
        </div>
      </div>
    </div>
  );
};

export default LoginPage;
